try:
    stabilizers_ps = [stim.PauliString(s) for s in stabilizers]
    tableau = stim.Tableau.from_stabilizers(stabilizers_ps, allow_underconstrained=True, allow_redundant=True)
    circuit = tableau.to_circuit("elimination")
    with open('circuit_133.stim', 'w') as f:
        f.write(str(circuit))
    print(circuit)
except Exception as e:
    print(f"Error: {e}")
